  function validation(key, value) {   
    switch (key) {
      case "examName":
        console.log("validation for",key)
        if (value==="") {
          document.getElementById("examname_error").classList.remove("d-none");
          document.getElementById("examname_error").classList.add("d-block");
          document.getElementById("examname_error").innerHTML =
