          document.getElementById("passpercentage_error").classList.remove("d-none");
          document.getElementById("passpercentage_error").classList.add("d-block");
          document.getElementById("passpercentage_error").innerHTML =
            "*please enter the passpercentage";
          setHasError(true);
        }
        

      
